import React from "react";
import { Link } from "react-router-dom";

import { Container } from "./styles";

const Login = () => {
  return (
    <Container>
      <span style={{ color: "#fff" }}>home</span>
      <Link to="/login">go login</Link>
    </Container>
  );
};

export default Login;
